import React from "react";

const BookInfo = ({ books }) => {
  return (
    <div className="books__body">
      <div className="books__main">
        <div className="books__container">
          <div className="row">
            <div className="book__selected--top"></div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default BookInfo;
